import React, { Component } from 'react'
import Nav from './components/Nav'
import Search from './components/Search'
import UserList from './components/UserList'

class App extends Component {
  render() {
    return (
      <div>
        <Nav />
        <Search />
        <UserList />

      </div>
    )
  }
}

export default App
